import React from 'react';
import './Form.css';
import text869 from './g6682.png';
import fondo2 from './64857.jpg';

const Form  = () => {
  return (

  <div className="flex items-center center f1-ns tc blue  artbg vh-75" >

    <form>
      <label>
        Name:

      </label>
      <input type="text" name="name" />

      <label>
        Name:
        <input
      //     onChange = {onEmailChange}
             className=" br2 input-reset ba b--white br2 h2 f4"
             type="email"
             name="email-address"
             id="email-address"
             placeholder="email@mail.com"
             required
            //   value= {onEmailChange.signInEmail}
             />
      </label>



      <input type="submit" value="Submit" />
    </form>

  </div>




  );


}

export default Form;
